,'The new ‘Ask Customers’ functionality is implemented - invite buyers to answer questions via direct emails.','http://ecommerce.aheadworks.com/magento-extensions/product-questions.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=pq2',0,0),(128,3,'2014-04-17 23:30:00','Easter Sale – 15% off Magento extensions and themes','Save on great solutions to improve your online store! Catch a 15% discount on all aheadWorks products. The sale runs through April 20.','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=easter2014',0,0),(129,4,'2014-05-13 08:46:11','Magento Community Edition 1.9 is now available!','It accelerates your entry into the mobile commerce space by slashing the time and cost of getting a mobile device-friendly responsive site.  And a new Bill Me Later payment option helps boost your sales. Visit http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time to learn more.','http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time',0,0),(130,3,'2014-06-12 08:00:00','Help Desk Ultimate v.3.0 by aheadWorks has been released!','Fully redesigned with absolutely new business logic! View help desk statistics, let customers escalate a ticket, assign a request to a specific agent and much more.','http://ecommerce.aheadworks.com/magento-extensions/help-desk-ultimate.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=hdu3',0,0),(131,3,'2014-06-03 09:00:00','Event Tickets v.1.1 by aheadWorks has been released!','Implement powerful and easy-to-use event & ticket management system on your website with the updated Event Tickets tool! Now you can send printable tickets, scan QR codes, redeem tickets using smartphones, and much more.','http://ecommerce.aheadworks.com/magento-extensions/event-tickets.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=et11',0,0),(132,3,'2014-06-30 00:58:00','Summer Sale – 20% OFF all Magento extensions','Summer days bring hot sales from aheadWorks! Seize the opportunity of a 20% discount on all Magento extensions and themes. Make haste to complete your order! The offer is time-limited.','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=summer2014',0,0),(133,3,'2014-07-05 00:59:00','Limited-time offer: Double Support Period for aheadWorks Products','In honor of Independence Day, we double support period for all Magento extensions by aheadWorks! Now all our products come with 180/360/720 days of support.','http://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=independence',0,0),(134,3,'2014-07-21 01:30:00','Photo Gallery Pro v.5.0 has been released!','Organize your pictures into albums and place photos on product pages! The look of a picture/album can be fully configured from the backend.','http://ecommerce.aheadworks.com/magento-extensions/photo-gallery-pro.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=gallery',0,0),(135,3,'2014-07-30 23:00:00','New version of aheadMetrics is out!','Get a deeper analysis of your business situation! aheadMetrics, the analytical tool from aheadWorks, is enhanced with new report types and restorable custom configurations. ','http://www.aheadmetrics.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=am',0,0);
