INSERT INTO `aw_blog` VALUES (2,'A Guide to Casual Sex','<p>Relationships can be great, but sometimes you\'re not in that space. You might want to focus on work, hobbies or friends. Perhaps you don\'t want to settle down; or you\'re after some holiday fun. Sex doesn\'t have to come with strings attached - but a little thought makes it lots more fun.</p>\r\n<p><br />1.&nbsp;&nbsp; &nbsp;Protect Yourself: Every new partner brings new sexual health risks, and if you don\'t use a condom you\'re asking for trouble (and maybe a baby).&nbsp; Remember oral sex carries risks of sexually transmitted infections (STI\'s) too.<br />2.&nbsp;&nbsp; &nbsp;Look and Learn: Check for other STI signs such as inflammation, sores and pain on intercourse: condoms don\'t protect against all STIs so you need to use your brain before you use your body. If in doubt, don\'t.<br />3.&nbsp;&nbsp; &nbsp;Get Tested Regularly: Many STI\'s don\'t have symptoms, so getting tested is the only way to ensure you\'re free of infection.<br />4.&nbsp;&nbsp; &nbsp;Wear an Emotional Condom: If you want sex to feel loved or boost your confidence, you\'re unlikely to be satisfied by sleeping around. After all, you can easily give yourself an orgasm without any heartache. Only have casual sex if it\'s not going to upset you.<br />5.&nbsp;&nbsp; &nbsp;Protect Your Reputation: If you choose to have casual sex, some people may judge you for it. Think carefully about who you tell about your lifestyle: but do listen if friends say they\'re concerned about your behaviour.<br />6.&nbsp;&nbsp; &nbsp;Stay Safe: Going home with a stranger has risks. Make sure a friend knows where you\'re going, who you\'re going with and when you\'ll be back - and don\'t invite strangers back to yours. Otherwise you could find your phone missing in the morning - or worse.<br />7.&nbsp;&nbsp; &nbsp;Be Honest: Lying to get someone into bed is unfair and can lead to trouble. Whether it\'s a reputation, a teary ex or a full-on bunny-boiler, bad things come from lying to get sex.<br />8.&nbsp;&nbsp; &nbsp;Choose Carefully: If you know someone, you\'re more likely to have mutual trust, affection and respect - and that makes for better sex. Don\'t pick someone who\'s in love with you for casual sex though - that\'s unfair on them.<br />9.&nbsp;&nbsp; &nbsp;Respect your Lover: Casual sex is about both people having fun so make sure they get as much out of it as you do.<br />10.&nbsp;&nbsp; &nbsp;Respect Yourself: Only have casual sex if you can do so while maintaining a healthy sense of self-esteem. Healthy sex doesn\'t make you feel bad afterwards: if you do, think about whether the sex you are having is right for you.<br />\"Casual sex is about both people having fun so make sure your partner gets as much out of it as you do.\"<br /><br /></p>',2,'2014-03-12 09:12:46','2014-04-28 05:38:56','sex-guide','brian zhang','brian zhang','','',0,'','<p>Relationships can be great, but sometimes you\'re not in that space. You might want to focus on work, hobbies or friends. Perhaps you don\'t want to settle down; or you\'re after some holiday fun. Sex doesn\'t have to come with strings attached - but a little thought makes it lots more fun.</p>\r\n<p><br />1.&nbsp;&nbsp; &nbsp;Protect Yourself: Every new partner brings new sexual health risks, and if you don\'t use a condom you\'re asking for trouble (and maybe a baby).&nbsp; Remember oral sex carries risks of sexually transmitted infections (STI\'s) too.<br />2.&nbsp;&nbsp; &nbsp;Look and Learn: Check for other STI signs such as inflammation, sores and pain on intercourse: condoms don\'t protect against all STIs so you need to use your brain before you use your body. If in doubt, don\'t.<br />3.&nbsp;&nbsp; &nbsp;Get Tested Regularly: Many STI\'s don\'t have symptoms, so getting tested is the only way to ensure you\'re free of infection.<br />4.&nbsp;&nbsp; &nbsp;Wear an Emotional Condom: If you want sex to feel loved or boost your confidence, you\'re unlikely to 