\n    <div class=\"box2 fr black  bg7\"><div class=\"divBottom\"><div class=\"title\">Introduction</div><p>Very Cherry Pleasure Gel </p></div></div>\r\n    <div class=\"clear\"></div>\r\n  </div>\r\n  <div class=\"box1 fr\">\r\n    <div class=\"box4 fl pink2\"><div class=\"topTitle\">Tips</div><p>Ways to Please your lady with a vibrator.Ways to Please your lady with a vibrator.Ways to Please your lady with a vibrator.</p></div>\r\n    <div class=\"box4 fr pink2 tc\"><img src=\"{{media url=\"wysiwyg/blog/Durex-blog_09.png\"}}\" alt=\"\" /></div>\r\n    <div class=\"box3 clear pink2\"><div class=\"topTitle\">First Time Buyer</div><p> Nervous about buying a sex toy for the first time?  Don’t be.  Our guide to sex toys for beginners will make the process painless, leaving you more time to enjoy your new toy.</p></div>\r\n  </div>\r\n  <div class=\"clear\"></div>\r\n</div>',1,'2014-04-14 18:01:40','2014-04-28 07:01:14','durexplore','brian zhang','brian zhang','','',0,'',''),(4,'Lube Dos and Don\'ts','<div id=\"blogContent\" class=\"content\">\r\n<!--<img src=\"{{media url=\"wysiwyg/blog/ImageGen-1.jpg\"}}\"  alt=\"\" class=\"postImg\" />-->\r\n<!--<div class=\"shortC\"><p>11No matter what your level of sexual experience, it’s never too late to be informed about how you might improve your sexual wellbeing.  One easy way to do so is to learn about how to properly use lube.  These products, known as lubes, lubricants or gels, can help to provide a wealth of different sensations and experiences and will undoubtedly add some spice to your sex life.</p></div>-->\r\n<h4>Types of Lubes</h4>\r\n<p>The first thing to know about lube is that there are three main varieties, categorised by their composition: </p>\r\n<p>•	Water-based: Water-based lubes are the most common variety and can be safely used with condoms.  All of Durex’s Pleasure Gels are water-based and can be used in many different ways.  </p>\r\n<p>•	Oil-based: Oil-based lubes are considered to be better lubricants but are not condom-safe and should never be used with condoms.  The oil in the lube can cause the condom’s material to degrade and render the condom ineffective.</p>\r\n<p>•	Silicone-based. Silicone-based lubes are usually condom-safe and serve as good lubricants, striking a middle ground between water- and oil-based varieties.</p>\r\n<p>In addition to different types of composition, there are also many different varieties of lubes that can add delicious flavours or enthralling sensations to your sex life.</p>\r\n<p>•	Many companies produce different flavours of lube including cherry, strawberry, and passion fruit.  These lubes are perfect if you and your partner like to include oral activities in foreplay.</p>\r\n<p>•	If you prefer sensations to flavours, many types of lubes and pleasure gels produce different feelings and sensations when they make contact with your skin.  For example, Durex Embrace Pleasure Gel produces warming and tingling effects when it is rubbed on skin.</p>\r\n<p>•	Some lubricants give you the best aspects of massaging gels and lube in one convenient package.  These lubes, if water-based, can be used for massaging as well as sexual intimacy.</p>\r\n\r\n<h4>How To Properly Use Lube</h4>\r\n<p>11No matter what kind of lube you’ve settled on, it’s important to learn how to use lube before getting started.  Everyone’s body is different, so it makes sense to do research and experiment before anointing any one type of lube as your favourite.  You may start by using a lube to masturbate to test how you like the sensations and the texture of the gel itself.  Lube adds extra slippery friction to masturbation, which should help increase the range of sensations you feel. </p>\r\n<p>If you have a partner, you can also use lubes for partner play. Lube can increase the intensity of all manners of activity.  Feel free to drizzle lube on different erogenous zones; don’t forget the skin is an erogenous zone itself, so feel free to add lube and spend time touching,