e skin, adding too much of this type of lube can cause skin irritation and discomfort.</p>\r\n<p>Now that you know the “Dos” and “Don\'ts” of lube, check out the selection of lubes available here on Durexjoy.com.  With free shipping and discreet delivery, there has never been a better way to enhance your sex life.  </p>\r\n</div>',1,'2014-04-14 23:05:47','2014-08-07 00:28:15','lube-dos','brian zhang','brian zhang','lubes, gels,sexual ,sex life','Lube Dos and Don\'ts. No matter what your level of sexual experience, lubes or gels can help improve your sexual experiences and add some spice to your sex life.',0,'','<img src=\"{{media url=\"wysiwyg/blog/ImageGen-1_1.jpg\"}}\"   alt=\"\" />\r\n<p>No matter what your level of sexual experience, it’s never too late to be informed about how you might improve your sexual wellbeing.  One easy way to do so is to learn about how to properly use lube.  These products, known as lubes, lubricants or gels, can help to provide a wealth of different sensations and experiences and will undoubtedly add some spice to your sex life.</p>'),(5,'Couples’ Tips for Vibrators','<img src=\"{{media url=\"wysiwyg/blog/couple_.jpg\"}}\"  alt=\"\" class=\"postImg\" />\r\n<div id=\"blogContent\" class=\"content\">\r\n\r\n<!--<div class=\"shortC\"><p>Using your vibrator alone can be an extremely enjoyable experience. Getting to know your own body and your most erogenous areas can hugely increase the level of sexual confidence and prowess you have when with someone else. </p>\r\n<p>However this is not the only way that vibrators can enhance your shared sex life. By introducing vibrators alongside lubes/gels into yours and your partners’ shared sex life you can add a whole new dimension of play with endless new ways to tease, excite and pleasure your partner. \r\n</p></div>-->\r\n<h4>Concerns:</h4>\r\n<p>So you’ve decided to open yourself up to a sexual awakening by introducing vibrators into yours and your partners’ sex life. It may seem a little daunt