o to Necessity</h4>\r\n<p>It was considered socially acceptable at the time for doctors to treat hysteriaby applying vegetable oil to women’s genitals and massaging them with their fingers, but it wasn’t until much more recently that vibrators as we know them were talked about openly.  Perhaps we can credit Sex and the City to freeing the vibrator talk or to at least getting it rolling.  In a 1998 episode the ladies of Sex and the City discussed their vibrator experiences over a cup of coffee.  </p>\r\n<p>Now many celebrities will openly share their choice in vibrators and vibrators can be found on your local high street.  Thank goodness.  Sex therapist and clinical psychologist David Schnarch was quoted in USA Today on the topic of couples use of vibrators, \"Couples are less willing to tolerate lousy sex…People have much higher expectations.\"  We’ve come a long way, so take advantage!\r\n</p>\r\n\r\n<h4>Durex History</h4>\r\n<p>Durex began in London, England as a rubber company making condoms.  The name, which was trademarked in 1929, is an abbreviation of \"Durability, Reliability, and Excellence.”  Now Durex makes approximately 1 billion condoms a year. That’s enabling a lot of sex!  </p>\r\n<p>The first decade of the 21st century brought some exploration to Durex, and Durex began making toys!  The toys available to you today come with 80 years of experience in sex.  Now you can buy vibrators in many shapes and sizes.  You can even own a vibrator that listens to your heart! The Durex Touch Sensor Vibrator uses biofeedback to automatically adjust to you and your needs!\r\n</p>\r\n\r\n<h4>Class Dismissed</h4>\r\n<p>Well, that brings us to the conclusion of this history lesson.  Hopefully it has given you good material for your next girl talk or perhaps something funny to tell your partner when suggesting the introduction of toys in the bedroom.  However you decide to apply this information, the next time you reach for your vibrator, have the peace of mind that there will be no bees inside.  After all, Durex is made with the highest quality material.  We believe in velvety soft not bee stings!</p>\r\n</div>',1,'2014-04-25 03:18:37','2014-08-07 00:26:37','the-history-of-vibrators','brian zhang','brian zhang',' history of vibrators, first vibrator,Durex History,Durex','Learn about the interesting and exciting history of vibrators. Vibrators have a long and interesting history possibly going back to the time of Cleopatra. Read more here.\r\n',0,'','<img src=\"{{media url=\"wysiwyg/blog/history.jpg\"}}\" alt=\"\"   />\r\n<p>There was a rumor going around that men thought about sex every seven seconds, people found that easy to believe, but then Psychology Today busted that bubble saying that there wasn’t actual research to back that up. Oh well, it was an interesting thought; I mean what were you thinking about in history class?  Who hasn’t daydreamed through a history lecture as you wondered when you would ever use the information later in life?  Well, what follows is a history lesson that should oscillate that brain of yours.</p>'),(7,'Vibrators and Your Sexual Health','<img src=\"{{media url=\"wysiwyg/blog/sextual.jpg\"}}\"  alt=\"\" class=\"postImg\" />\r\n<div id=\"blogContent\" class=\"content\">\r\n\r\n<!--<div class=\"shortC\"><p>Isn’t it incredible when you discover a really healthy food that is also quite scrumptious?  Here at Durex, we don’t claim to be your daily dose of vegetables, but with many origins rooted in the medical field, we are certain that our vibrators will bring more to your well being than just an incredible orgasm (as if that isn’t enough). As you pleasure yourself and/or your partner, you can also have the additional satisfaction of the health benefits gained from using a vibrator.\r\n</p>\r\n\r\n</div>-->\r\n<h4>Men, it’s not just a girl thing</h4>\r\n<p>According to an article published by Science Daily, 44.8 percent of American men have incorporated a vibrator into sexual activities at some point