INSERT INTO `catalog_product_entity_text` VALUES (205,4,57,0,49,'<p><strong>Explore. Excite. Embrace.&nbsp;<br /></strong>Made for couples&rsquo; mutual pleasure, Durex Embrace Pleasure Gel contains two gels that are sure to help elevate your sexual experiences. The &ldquo;For Me&rdquo; gel is silky smooth and produces a warming sensation, while the &ldquo;For You&rdquo; gel will arouse your partner with its sensual and tingling effects. With these pleasure gels, you&rsquo;ll wish each embrace would last a lifetime.</p>'),(206,4,58,0,49,'<p><span style=\"color: #ff0098;\"><span style=\"color: #ffffff;\">FEATURES</span></span><span style=\"color: #000000;\"><span style=\"color: #ff0098;\"><br />Usage:</span> <span style=\"color: #ffffff;\">Meant for use with Durex sex toys and condoms, or for massaging purposes.</span><span style=\"color: #ff0098;\"><br />Composition:</span> <span style=\"color: #ffffff;\">Durex Embrace Pleasure Gels are water-based.</span><span style=\"color: #ff0098;\"><br />Expiration Date:</span> <span style=\"color: #ffffff;\">Two years after production.</span><span style=\"color: #ff0098;\"><br />Volume:</span> <span style=\"color: #ffffff;\">Two (2) 60 mL bottles (2X60mL).</span></span></p>'),(207,4,68,0,49,'Pleasure gel, Embrace, best female lubricant, lube for sex, flavored lubricant, pleasure gels  '),(208,4,89,0,49,NULL),(257,4,57,0,50,'<p><strong>Double The Vibrations, Double The Fun.</strong><br /> This uniquely-designed Durex product is guaranteed to bring a new rhythm into your sex life.&nbsp; With five different speeds and vibration settings, this vibrator has just the right moves for every situation. &nbsp;Its two-sided design allows you to explore different erogenous zones and ensures that you&rsquo;ll never feel the same sensations twice: tease, flirt and tickle to your heart&rsquo;s&mdash;or other parts&rsquo;&mdash;desire.&nbsp; Tantalizing curves and plush materials will stimulate your senses and elevate your pleasure to new hei