preferences, needs, desires and to exceed them unconditionally.</p>\r\n<p><br />DurexJoy is our official online store where you can find toys, lubes and other products that have been expressly designed to satisfy your most personal and passionate desires.  These products carry the Durex name and thus are lovingly crafted from only the highest quality materials and have passed rigorous testing regimes to ensure your desires are sated and your health is protected.  </p>\r\n<p><br />When purchasing a Durex product, you are doing much more than simply buying a new gadget, condom or lube.  Our products empower you to explore and expand your sexual horizons and sexual wellbeing.  Whether using the device by yourself or with a partner, Durex’s quality products will help you to love and experience great sex.</p>\r\n<p><br />Purchasing Durex products has never been easier.  Buying online from DurexJoy is safe and secure. Of course, your personal information will never be sold or shared.  All of our products will be delivered in plain, non-descript plastic shipping envelopes to protect your privacy. DurexJoy employs PayPal and Global Pay, two of the world\'s top payment gateways, to make your shopping experience as easy and as safe possible.</p>\r\n<p><br />We’re sure you’ll love our products, and we back up our claims with a 30-day unconditional warranty.  If you are not totally satisfied with your purchase, you can receive a refund for your purchase or exchange the product within 30 days of the original purchase date.</p>\r\n<p><br />We’re sure you’ll love our products, and we back up our claims with a 30-day unconditional warranty.  If you are not totally satisfied with your purchase, you can receive a refund for your purchase or exchange the product within 30 days of the original purchase date.\r\nHere at Durexjoy, your pleasure is our passion.<br /><br /></p>','2007-08-30 06:01:18','2014-07-10 14:44:32',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(12,'Help','one_column',NULL,NULL,'help',NULL,'<div class=\"page-title\" style=\"display:none;\">\r\n<h2>Help</h2>\r\n</div>\r\n<div class=\"page-help\">\r\n<div class=\"para\">\r\n<h3 style=\"display:none;\">Delivery</h3>\r\n<p><br /><strong>What shipping providers does Durexjoy use? And how much will shipping cost?</strong><br />We work closely with Aramex to deliver our products to your door. Once your order is confirmed, we will arrange delivery as soon as possible. Normally, it takes around three (3) days for your order to be delivered to your door.</p>\r\n<p><br />As of March 2014, we will be providing free shipping on all orders, no matter how big or small the order is.&nbsp; For an idea of how much you will save buying online today, please refer to the pricing table below.</p>\r\n<p><br />Shipping costs, when applicable, are as follows:</p>\r\n<p>&nbsp;</p>\r\n<table style=\"width: 400px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"400\">\r\n<p>Shipping Cost of Your First Product</p>\r\n</td>\r\n<td valign=\"top\" width=\"71\">\r\n<p>&pound;7 (7 GBP)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"400\">\r\n<p>Shipping Cost of Each Additional Product</p>\r\n</td>\r\n<td valign=\"top\" width=\"71\">\r\n<p>&pound;2* (2 GBP)</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br />*Note: Due to fluctuations in the prices of fuel and other variables, the price of shipping products beyond your first purchase may fluctuate in real time accordance with Aramex&rsquo;s real-time shipping costs.<br /></p><br />\r\n<p><strong>What if I am out when my order is delivered?</strong><br />If you are out when your order arrives, our courier will leave a note at your door and contact you to arrange a second delivery visit.<br />&nbsp;<br /><strong>Will others know that I have purchased toys from durexjoy.com?</strong><br />Durex cares about your privacy as much as you do. Your products will be well packaged and delivered in a non-descript cardboard box or shipping envelope. You can be assured that your personal information, privacy and shipping details will be protected.</p>\r\n<p><br /><strong>What if my order doesn\'t arrive when I expect it to?</strong><br />If your parcel is not delivered within five (5) working days of being shipped, please contact us via customerservice@durexjoy.com. We will contact the delivery company to make sure you receive your product(s) as soon as possible.<br />Purchasing</p>\r\n<p><br /><strong>How do I calculate the total price of my purchase, including shipping costs, and then place my order?</strong><br />The prices displayed on the product information pages do not include shipping costs. The following steps allow you to calculate the shipping cost of your orders:</p>\r\n<p><br />&bull;&nbsp;&nbsp; &nbsp;Add the item to your shopping bag<br />&bull;&nbsp;&nbsp; &nbsp;Click &ldquo;Proceed to Checkout&rdquo; on the shopping bag page<br />&bull;&nbsp;&nbsp; &nbsp;Signup/login to your account, or checkout as a guest<br />&bull;&nbsp;&nbsp; &nbsp;Enter your billing address and shipping address<br />&bull;&nbsp;&nbsp; &nbsp;Review order summary<br />&bull;&nbsp;&nbsp; &nbsp;Click &ldquo;Place Your Order&rdquo; to make payment</p>\r\n<p><br />Adding an item to your bag doesn\'t mean you have ordered it. If you no longer want an item after seeing the estimated shipping costs, simply click &ldquo;Remove Product&rdquo; to delete it from your bag.</p>\r\n<p><br />Once your order has shipped, we will send you an email with detailed shipping information including your order details and tracking code.</p>\r\n<p><br /><strong>How do I make a payment for my order?</strong> <br />We work with Paypal and Global Pay Payment Gateway to ensure your payment details are safe and that completing the purchase process is as easy as possible. Your money, personal details and privacy will always be protected by our payment gateways and partners.</p>\r\n</div>\r\n<div class=\"para\">\r\n<h3><br />Privacy</h3>\r\n<p><br /><strong>Is my information safe with Durexjoy.com?</strong><br />Our customers&rsquo; privacy is one of our highest priorities. We guarantee the safety of our customers&rsquo; personal information and purchase history. We will not sell your information to or share it with any third parties. Your private shopping history will be always private.&nbsp; We also do everything possible to guarantee that no one will know the contents of your delivery box.</p>\r\n<p><br /><strong>What cookies are used on Durexjoy?</strong></p>\r\n<p><br />Durexjoy uses cookies to track your browsing behaviour on our site. We use this information to enhance your future shopping experiences and remember your preferences to deliver better service.&nbsp; You will always have the option to disable cookies in your browser or on your device.</p>\r\n</div>\r\n<div class=\"para\">\r\n<h3><br />Returns, Exchanges and Complaints</h3>\r\n<p><br /><strong>Can I return or exchange the products I have purchased if I am not satisfied with them?</strong><br />We guarantee that our products are made of the highest quality inputs and are crafted with your pleasure in mind.&nbsp; However, if you are not satisfied with the products you receive, we offer a 30-day warranty for returning or exchanging products.</p>\r\n<p><br /><strong>How can I make a return or exchange my product?</strong><br />You may contact Durexjoy&rsquo;s customer service department at customerservice@durexjoy.com to request a return or exchange of your product(s). You will need to fill out a form with shipping and personal details and return the product through a local delivery company. Once we receive the product, we will refund the product price and shipping cost, or send you a new product if applicable.</p>\r\n<p><br /><strong>How can I contact Durexjoy if I am not satisfied with the service I receive?</strong><br />We care about the feedback we receive from our customers and strives to satisfy the needs of our