o not create and/or publish your own database that features substantial parts of any Contents without our express consent.</p>\r\n<p>2. While RB has made reasonable efforts to include Information at this website that is accurate and timely, RB makes no representations or warranties as to the accuracy of such Information and, specifically, RB assumes no liability or responsibility for any errors or omissions in the Information or the Contents of this website. Moreover, RB neither warrants nor represents that your use of the Information will not infringe the rights of third parties who are not affiliated with RB. Your access to and use of this website are at your own risk, and neither RB nor any party involved in the creation, transmittal, or maintenance of this website shall be liable to you for any direct, indirect, consequential, incidental or punitive damages of any kind allegedly arising out of your access or use of this website, or your inability to access or use this website. Notwithstanding anything to the contrary contained herein, the Contents of this website are provided to you on an \"AS IS\" basis and specifically WITHOUT WARRANTY OF ANY KIND, WHETHER EXPRESSED OR IMPLIED, INCLUDING, BUT NOT LIMITED TO, THE IMPLIED WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, OR NON-INFRINGEMENT. Please note that some jurisdictions may not permit the exclusion of implied warranties and, as a result, some of the exclusions referenced above may not apply to you. You should check your local laws for any limitations or restrictions that might impact you.</p>\r\n<p>3. You are responsible for maintaining the confidentiality of your account and password and for restricting access to your computer, and to the extent permitted by applicable law you agree to accept responsibility for all activities that occur under your account or password. RB assumes no responsibility and shall not be liable for any damages to, or any viruses that may infect, your computer equipment resulting from your access to or use of this website, or the downloading of any Information from this website.</p>\r\n<p>4. The trademarks, logos and service marks (\"Trademarks\") displayed throughout the website are registered and unregistered Trademarks of RB, its affiliates and third party licensors. No license, right or permission is granted to you for any use of the Trademarks by you or anyone authorized by you. Misuse of the Trademarks is strictly prohibited and RB will aggressively enforce its intellectual property rights to the fullest extent of the law, including the pursuit of criminal prosecution whenever and wherever necessary.</p>\r\n<p>5. The pictures and images of people, products, places, or things displayed on this website are either the property of RB or are used with the permission of third parties. Any use of such pictures or images by you or anyone authorized or affiliated with you is strictly prohibited. Unauthorized uses of pictures and images may violate copyright or trademark laws, privacy laws, or communication laws or regulations.</p>\r\n<p>6. Descriptions of RB\'s products contained within the website shall not constitute product labeling. You should use RB\'s products in accordance with the instructions contained on the cartons and labels found on those products.</p>\r\n<p>7. Any communication or material transmitted to this website by electronic mail or other means, shall be treated as nonconfidential and nonproprietary. This includes ideas, suggestions, comments, questions and any other information or data. Anything submitted to RB can be used, reproduced, transmitted, disclosed or published by RB or its affiliates without restriction or compensation.</p>\r\n<p>8. RB has not reviewed all of the website that are linked to this website. As a result, RB is not responsible for the content of such linked sites and your linking to such websites is at your own risk.</p>\r\n<p>9. RB reserves the right to alter or delete any material from the Content of this website at any time. RB further reserves the right to discontinue this website at any time and without notice.</p>\r\n<p>10. These conditions are governed by and construed in accordance with the laws of Hong Kong, without regard to any conflicts of law provisions. Any disputes shall be submitted to the non-exclusive jurisdiction of the courts of the Hong Kong. Any cause of action with respect to this website or these conditions must be filed within one year after the cause of action has accrued; unless such a filing is made in accordance with such rules, the cause shall be permanently barred. In no event shall you be entitled to injunctive or other equitable relief.</p>\r\n<p>11. If any provision of these terms shall be unlawful, void, or for any reason unenforceable, then that provision shall be deemed severable from these terms and shall not affect the enforceability of any remaining provisions. This is the entire agreement between us relating to the subject matter herein and shall not be modified except in writing, signed by both parties.</p>\r\n<p>Conditions of Sale</p>\r\n<p>1. General: By placing an order with RB, you signify your agreement to be bound by these conditions. We offer a wide range of RB Services, and sometimes additional terms may apply. When you use an RB Service, you will also be subject to the terms, guidelines and conditions applicable to that RB Service (\"Service Terms\"). If these Conditions of Sale are inconsistent with the Service Terms, those Service Terms will prevail.</p>\r\n<p>2. Contract: Your order is an offer to RB to buy the product(s) in your order. When you place an order to purchase a product from RB, we will send you an e-mail confirming receipt of your order and containing the details of your order (the \"Order Confirmation E-mail\"). The Order Confirmation E-mail is acknowledgement that we have received your order, and does not confirm acceptance of your offer to buy the product(s) ordered. We only accept your offer, and conclude the contract of sale for a product ordered by you, when we dispatch the product to you and send e-mail confirmation to you that we\'ve dispatched the product to you (the \"Dispatch Confirmation E-mail\"). If your order is dispatched in more than one package, you may receive a separate Dispatch Confirmation E-mail for each package, and each Disptach Confirmation E-mail and corresponding dispatch will conclude a separate contract of sale between us for the product(s) specified in that Dispatch Confirmation E-mail. Your contract is with RB. You can cancel your order for a product at no cost any time before we send the Dispatch Confirmation E-mail relating to that product.</p>\r\n<p>3. Return: The Durex brand stands for quality, innovation and satisfaction. If you are not completely satisfied with your product within the first 30 days of ownership, please contact our Consumer Relations for an exchange or full refund. Shipping charges and VAT will only be refunded in cases where our error caused the return or the item is defective. RB does not take title to returned items until the items arrive at the returns address destination. At our discretion, a refund may be issued without requiring a return. In this situation, RB does not take title to the refunded item.<br />Consumer Relations Mailing Address: customerservice@durexjoy.com</p>\r\n<p>4. Pricing and availability: All prices are exclusive of legally applicable VAT. Despite our best efforts, a small number of the items in our catalogue may be mispriced. We will verify pricing when processing your order and before we take payment. If we have made a mistake and a product\'s correct price is higher than the price on the website, we may either contact you before shipping to request whether you want to buy the product at the correct price or cancel your order. If a product\'s correct price is lower than our stated price, we will charge the lower amount and send you the product.<br />We list availability information for products sold by us on the website including on each product information page. Beyond what we say on that page or otherwise on the website, we cannot be more specific about availability. As we process your order, we will inform you by e-mail as soon as possible if any products you order turn out to be unavailable and you will not be charged for those products.</p>\r\n<p>5. Delivery: Unless otherwise stated on the website, delivery estimates are just that. They are not guaranteed delivery times and should not be relied upon as such.</p>\r\n<p>6. Product information: Unless expressly indicated otherwise, all information about the products on our website is provided for information purposes only. We recommend that you do not rely solely on the information presented on our website. Please always read labels, warnings and directions provided with the product before use.</p>\r\n<p>7. Promotional code and online offer terms and conditions: From time to time we may issue promotional code (&ldquo;Code&rdquo;) to individuals or groups of people. General terms for the use of promotional code are set out as below. In the event of discrepancies between general terms and specific terms of each code, the specific terms shall prevail.</p>\r\n<p>- Code cannot be combined with other offers<br />- Limit one Code per customer<br />- Code cannot be used to purchase online gift vouchers<br />- Code is not transferrable and may not be resold<br />- Code is not valid in any of our stores worldwide<br />- Void where prohibited<br />- RB reserves the right to withdraw or alter any promotion at any time at their discretion without prior notification.<br />- To claim your discount you should enter the code in the promotional box when you checkout.<br />- In the instance that you find a code is not working on the website, please call our Customer Relationships at customerservice@durexjoy.com.</p>\r\n<p>8. Our liability: RB and its affiliates will not be responsible for (i) losses that were not caused by any breach on our part, or (ii) any business loss (including loss of profits, revenue, contracts, anticipated savings, data, goodwill or wasted expenditure), or (iii) any indirect or consequential losses that were not foreseeable to both you and us when the contract for the sale of products by us to you was formed. <br />Nothing in these conditions limits or excludes our responsibility for fraudulent representations made by us or for death or personal injury caused by our negligence or willful misconduct.<br />We will not be held responsible for any delay or failure to comply with our obligations under these conditions if the delay or failure arises from any cause which is beyond our reasonable control. This condition does not affect your right to have the products sent to you within a reasonable time. If the delay occurs before the products are dispatched, we will not charge you for the products until they are dispatched and you may cancel your order at any time prior to dispatch.</p>\r\n<p>9. Applicable law: These conditions are governed by and construed in accordance with the laws of Hong Kong, without regard to any conflicts of law provisions. Any disputes shall be submitted to the non-exclusive jurisdiction of the courts of the Hong Kong. Any cause of action with respect to this website or these conditions must be filed within one year after the cause of action has accrued; unless such a filing is made in accordance with such rules, the cause shall be permanently barred. In no event shall you be entitled to injunctive or other equitable relief.</p>\r\n<p>10. Amendments to the conditions of sale: We reserve the right to make changes to our website, policies, and terms and conditions, including these Conditions of Sale at any time. You will be subject to the terms and conditions, policies and Conditions of Sale in force at the time that you order products from us, unless any change to those terms and conditions, policies or these Conditions of Sale is required to be made by law or government authority (in which case it may apply to orders previously placed by you). If any of these Conditions of Sale is deemed invalid, void, or for any reason unenforceable, that condition will be deemed severable and will not affect the validity and enforceability of any remaining condition.</p>\r\n<p>11. Waiver: If you breach these Conditions of Sale and we take no action, we will still be entitled to use our rights and remedies in any other situation where you breach these Conditions of Sale.</p>\r\n<p>12. Children: We do not sell products for purchase by children. If you are under 18, please exit this website now.</p>\r\n<p>13. Privacy:<br />Collection of Personal Information</p>\r\n<p>We collect the following types of personal information in order to provide you with the use of and access to our sites, applications, services and tools, and to help us personalize and improve your experience:</p>\r\n<p>Automatic Information: We receive and store certain types of information whenever you interact with us. When you visit our site at durexjoy.com, use our applications, services and tools, we automatically collect information sent to us by your computer, mobile access or other access devices.</p>\r\n<p>Information You Give US: We received and store any information you enter on at durexjoy.com or give us in any other way. This information may include, but is not limited to: (1) information you provide us when registering for an account; (2) shipping, billing and other information you provide to purchase an item; and (3) information provided in the context of community discussion, chats or correspondence through durexjoy.com or correspondence sent to us.</p>\r\n<p>Mobile: When you download or use apps created by RB or our subsidiaries, we may receive information about your location and your mobile device, including a unique identifier for your device.</p>\r\n<p>Information from Other Sources: We may receive or collect information about you from other sources and add it to our account information. This may include, but is not limited to, demographic, navigation information, additional contact information and credit check information.</p>\r\n<p>About Cookies</p>\r\n<p>We use cookies to keep track of your current shopping at durexjoy.com to help provide you with a better, faster and safer experience. You may retrieve your shopping basket at any time, and to personalize the contents our website as well as to ensure a consistent experience. Cookies, by themselves, do not tell us your e-mail address or other personally identifiable information. However, we may combine this information with other information collected from or about you in order to help customize content.</p>\r\n<p>Use of Personal Information</p>\r\n<p>Our primary purpose in collecting personal information is to provide you with access to our sites and/or use of our services, applications and tools, provide you with requested customer service and relevant information about your account and our services, and to provide you with a safe, smooth, efficient, and customized experience. You agree that our use of your personal information might include but not limited to: <br />1) provide you access to durexjoy.com and the services and customer support you request; <br />2) customize, measure and improve our services, content and advertising; <br />3) prevent, detect, and investigate, fraud, security breaches, potentially prohibited or illegal activities<br />4) contact you, either via email or telephone to inform you about our services, deliver targeted marketing, service updates, and promotional offers based on your communication preferences;<br />5) provide you other services requested by you as described when we collect the information.</p>\r\n<p>Protection of Your Personal Information</p>\r\n<p>We treat your personal information as confidential. We protect your personal information using reasonable security measures to reduce the risks of loss, misuse, unauthorized access, disclosure and alteration. The information we hold will be accurate and up to date, and we provide you with the opportunity to update your personal information through your account profile settings. We retain information as long as it is necessary and relevant for our operations. In addition, we may retain personal information from closed accounts to comply with the law, prevent fraud, collect any fees owed, resolve disputes, troubleshoot problems, assist with any investigation and take other actions permitted by applicable laws.</p>\r\n<p>14. International Shipping<br />These terms and conditions are in addition to the standard Conditions of Use and Sale.</p>\r\n<p>1) Those items for shipment to countries outside of the Hong Kong may be subject to taxes, customs duties and fees levied by the destination country (\"Import Fees\"). The recipient of the shipment is the importer of record in the destination country and is responsible for all Import Fees.</p>\r\n<p>2) With respect to each item for which Import Fees have been calculated, you authorize RB to designate a carrier (\"Designated Carrier\") to act as your agent with the relevant customs and tax authorities in the destination country, to clear your merchandise, process and remit your actual Import Fees for such item.</p>\r\n<p>3) &ldquo;Import Fees Deposit&rdquo; represents an estimate of the Import Fees that will be levied on the items in your order for shipment to countries outside of Hong Kong. By placing your order, you agree to allow RB to collect the Import Fees Deposit for the applicable items in your order. This deposit will be used, on your behalf, to reimburse the Designated Carriers for the import fees that they have paid on your behalf to the appropriate authorities of the destination country.</p>\r\n<p>4) You further agree that the Designated Carriers may disclose to RB the amount of actual Import Fees levied on the item you have purchased from RB (\"Actual Import Fees\"). In the event that the Import Fees Deposit exceeds the Actual Import Fees, RB will refund the difference to you.</p>\r\n<p>5) In the case of gifts or other purchases made on behalf of another recipient, you also agree to grant the foregoing authorizations on behalf of the recipient designated in your order.</p>\r\n<p>6)To obtain details regarding the Actual Import Fees, or to obtain documentation or receipts in connection with customs clearance, you may contact the Designated Carrier specified in your shipment confirmation e-mail.</p>\r\n<p>7) Title and risk of loss for the items transfer to the recipient upon delivery to the common carrier in Hong Kong.</p>\r\n<p>8) For products shipped internationally, please note that any manufacturer warranty may not be valid; manufacturer service options may not be available; product manuals, instructions and safety warnings may not be in destination country languages; the products (and accompanying materials) may not be designed in accordance with destination country standards, specifications, and labeling requirements; and the products may not conform to destination country voltage and other electrical standards (requiring use of an adapter or converter if appropriate). You are responsible for assuring that the product can be lawfully imported to the destination country. When ordering from this website, the recipient is the importer of record and must comply with all laws and regulations of the destination country.</p>\r\n<p>9) Your privacy is important to us. Please note that cross-border shipments are subject to opening and inspection by customs and/or postal authorities. Also, we may provide certain order, shipment, and product information, such as titles, to our international carriers, and such information may be communicated by the carriers to customs and/or postal authorities in order to facilitate customs clearance and comply with local laws.</p>\r\n<p>&nbsp;</p>\r\n</div>','2013-11-06 21:43:38','2014-07-10 14:59:27',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(15,'Our Privacy Policy','one_column',NULL,NULL,'privacy-policy',NULL,'<style>\r\n.bg_nav{display:none}\r\n.main-container {\r\nmargin-top: 0px;\r\n}\r\n.welcome-msg{display:none}\r\n.col-main .std{padding:10px 0px; background:#000}\r\n</style>\r\n<div class=\"page-title\" style=\"display:none;\">\r\n<h2>Our Privacy Policy</h2>\r\n</div>\r\n<div class=\"page-pp\">\r\n<p>We respect your privacy and protecting it is just as important to us as it is to you.&nbsp; In course of shopping in our site, we will ask you to provide information related to your purchase including (but not limited to): name, email address, shipping address, billing address, product choices, credit card number and information and/or personal information related to other forms of payment.</p>\r\n<p><br />In the course of your visit, we may also ask for and collect information about where you have been browsing online (including what website you came from, your IP address and the types of domains you have visited), what browser you are using, the location of your internet service provider, what pages on our site you have visited and any search terms that you entered and used.<br />The personal information you provide to us is used for the following purposes/activities:<br />1.&nbsp; To improve the shopping experience you have on our website<br />2.&nbsp; To process and ship your order<br />3.&nbsp; As long as you give us permission, to alert you about products or special sales that might be of interest to you</p>\r\n<p><br /><strong>We Will Protect Your Email Address</strong><br />We will utilise your email address to assist with processing your order and to alert you about new products, special sales or other similar topics.&nbsp; We will not sell, give or lease your email address or other personal information to any third party.&nbsp; We will, however, integrate it into Reckitt Benckiser&rsquo;s databases.&nbsp; However, this integration will not result in you receiving emails or promotional materials from any other RB brands or divisions.</p>\r\n<p><br /><strong>We will keep your private information private.</strong><br />All the information you give to us will be treated as confidential within the Reckitt Benckiser Corporation.&nbsp; We will make every effort to ensure that the information we keep on file is up to date and accurate.&nbsp; You can check what information we have on file by emailing us at customerservice@durexjoy.com and requesting to check or update your information.&nbsp; We will be happy to update or delete any inaccurate information on your behalf. &nbsp;<br />We will store your personal information securely in accordance with Reckitt Benckiser&rsquo;s policies and Hong Kong law.</p>\r\n<p><br /><strong>Use of Cookies Onsite</strong><br />We use cookies to track your shopping session(s) so that you can access your shopping bag at any time.&nbsp; Cookies are also used to help customise our website content and ensure that your shopping experience is consistent and enjoyable.&nbsp; Finally, cookies are used to track how visitors to our site interact with it and to check how our site is performing.&nbsp; No information that could identify you personally is stored in these cookies.<br /><br /><strong>Our site uses the following cookies:</strong><br />1.&nbsp; Magento: Our website uses the Magento eCommerce platform.&nbsp; Magento installs the following cookies, some or all of which may be used on our site at any given time:<br /><br />CART&nbsp;&nbsp; &nbsp;The association with your shopping cart.<br />CATEGORY_INFO&nbsp;&nbsp; &nbsp;Stores the category info on the page, that allows to display pages more quickly.<br />COMPARE&nbsp;&nbsp; &nbsp;The items that you have in the Compare Products list.<br />CURRENCY&nbsp;&nbsp; &nbsp;Your preferred currency<br />CUSTOMER&nbsp;&nbsp; &nbsp;An encrypted version of your customer id with the store.<br />CUSTOMER_AUTH&nbsp;&nbsp; &nbsp;An indicator if you are currently logged into the store.<br />CUSTOMER_INFO&nbsp;&nbsp; &nbsp;An encrypted version of the customer group you belong to.<br />CUSTOMER_SEGMENT_IDS&nbsp;&nbsp; &nbsp;Stores the Customer Segment ID<br />EXTERNAL_NO_CACHE&nbsp;&nbsp; &nbsp;A flag, which indicates whether caching is disabled or not.<br />FRONTEND&nbsp;&nbsp; &nbsp;You sesssion ID on the server.<br />GUEST-VIEW&nbsp;&nbsp; &nbsp;Allows guests to edit their orders.<br />LAST_CATEGORY&nbsp;&nbsp; &nbsp;The last category you visited.<br />LAST_PRODUCT&nbsp;&nbsp; &nbsp;The most recent product you have viewed.<br />NEWMESSAGE&nbsp;&nbsp; &nbsp;Indicates whether a new message has been received.<br />NO_CACHE&nbsp;&nbsp; &nbsp;Indicates whether it is allowed to use cache.<br />PERSISTENT_SHOPPING_CART&nbsp;&nbsp; &nbsp;A link to information about your cart and viewing history if you have asked the site.<br />POLL&nbsp;&nbsp; &nbsp;The ID of any polls you have recently voted in.<br />POLLN&nbsp;&nbsp; &nbsp;Information on what polls you have voted on.<br />RECENTLYCOMPARED&nbsp;&nbsp; &nbsp;The items that you have recently compared. <br />STF&nbsp;&nbsp; &nbsp;Information on products you have emailed to friends.<br />STORE&nbsp;&nbsp; &nbsp;The store view or language you have selected.<br />USER_ALLOWED_SAVE_COOKIE&nbsp;&nbsp; &nbsp;Indicates whether a customer allowed to use cookies.<br />VIEWED_PRODUCT_IDS&nbsp;&nbsp; &nbsp;The products that you have recently viewed.<br />WISHLIST&nbsp;&nbsp; &nbsp;An encrypted list of products added to your Wishlist.<br />WISHLIST_CNT&nbsp;&nbsp; &nbsp;The number of items in your Wishlist.</p>\r\n<p><br />2.&nbsp; Google Analytics: Google Analytics (GA) is a very commonly used software that allows us to track, improve and optimise the way in which users find and interact with our website.&nbsp; GA records information about how users reach our site, the location from which users are browsing, and what browsers users are employing to browse our site.&nbsp; It also allows us to see how users use and interact with our site while making purchases online.&nbsp; We do not pass any personally identifiable information to Google. &nbsp;<br />We use the Google Analytic software &ldquo;ga.js JavaScript Library&rdquo;, which uses a first party cookie to help use gauge website usage.&nbsp; This library installs the following cookies: _utma (distinguishes between users and sessions), _utmb (determines new sessions and visits), _utmz (records traffic source and campaign pathway by which users reach our site) and _utmc (interoperable with other cookies and works with _utmb to determine if a user represents a new visit or session).</p>\r\n<p><br />3.&nbsp; Google Adwords: Google Adwords is a service provided by Google that allows us to engage in search engine marketing.&nbsp; Google Adwords uses the same cookies as Google (listed above).&nbsp; We do not pass any personally identifiable information to Google. &nbsp;</p>\r\n<p><br />4.&nbsp; OLark: OLark is a live chat service that allows us to better connect with uses onsite.&nbsp; OLark uses the following cookies:<br /><br />Cookie Name&nbsp;&nbsp; &nbsp;Cookie Description<br />hblid&nbsp;&nbsp; &nbsp;a visitor identifier that we use only on your site to remember this visitor between visits<br />wcsid&nbsp;&nbsp; &nbsp;a session identifier that we use only on your site to keep track of a single chat session <br /><br />olfsk&nbsp;&nbsp; &nbsp;storage identifier that we use to maintain chat state across pages (e.g. message history)<br />_okbk&nbsp;&nbsp; &nbsp;extra state information (e.g. chat box being open/closed)<br />_ok&nbsp;&nbsp; &nbsp;most recent Olark site ID (security measure)<br />_oklv&nbsp;&nbsp; &nbsp;the Olark loader version (for improved caching)<br />_okla&nbsp;&nbsp; &nbsp;used for caching purposes (loaded from CDN vs. loaded from our infrastructure)<br />_okgid&nbsp;&nbsp; &nbsp;group id the visitor is locked to<br />_okac&nbsp;&nbsp; &nbsp;used for caching by setting a hash for assets to determine if they have changed and if they need to be refreshed<br />_okck&nbsp;&nbsp; &nbsp;to test whether the visitor\'s browser allows cookies to be stored</p>\r\n<p>If you have more questions about cookies, please do not hesitate to contact us at customerservice@durejox.com<br /><br /></p>\r\n</div>','2014-04-03 12:01:24','2014-07-10 14:55:42',1,0,NULL,NULL,NULL,NULL,NULL,NULL);
